import React from "react";
function PosteVote() {
  return (
    <>
      <div className="vote">
        <h4 className="dateNote">mercredi 26 janvier 2022</h4>
        <div id="borderVote">
          <p className="titleVote">cvb</p>

          <div className="choix">
            <p className="value"></p>
            <p className="resulta"></p>
          </div>
          
        </div>
      </div>
    </>
  );
}

export default PosteVote;
